import React from 'react'

function CityInfo({setCurView,name,newCities,setNewCities,isCityForecast}) {
  const Cards = newCities.map((cityName) => 
        <CityCard  
            setCurView={setCurView} 
            name={cityName} 
            newCities={newCities} 
            setNewCities={setNewCities}
            isCityForecast = {false}
        />)
  return (
    <div class="singleview">
      <div class="header">
        <div class="logoname">
          <img class="applogo" src="https://cdn-icons-png.flaticon.com/512/1163/1163712.png"></img>
          <h1 class="appname">Weather <strong>App</strong></h1>
        </div>
      </div>
      <div class="searching">
        Tutaj info o mieście
      </div>
      <div class="space">
        Tutaj karty z pogodą z kilku wcześniejszych dni
        {Cards}
      </div>
    </div>
  )
}

export default CityInfo
